import logo from './logo.svg';
import './App.css';

import { useEffect, useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
} from "react-router-dom";
import Header from './Components/Header';


function App() {
  return (
    <div className="App">
      <Router>
        <Header></Header>
      </Router>
    </div>
  );
}

export default App;
